import React from 'react';
import ShowList from './ShowList';


class App extends React.Component {
  constructor() {
    super();
    this.state = {
      feeds: []
    };
  }


  componentDidMount() {
    console.log("test1")
    window.fbAsyncInit = () => {
      window.FB.init({
        appId      : '1747983188680794',
        autoLogAppEvents : true,
        xfbml            : true,
        version          : 'v3.3'
      });

      var token = "EAAY1yA0I4FoBAHnqEmXHAEvGOalte6tfE4sDYHs4YoFHVZAX5FXJw8Bw42Ilwg28SmnZA5CPJEVTdZAgnZBDGioZBCZCg51hzCypaYTh5pb2JJOq7Ncyp9iffA1n9ca2v4WQZBcR9nEIj9AOkd5CUfOp0noRF7TwOfTQwYCqPnDFXMHbHPR1v2BaWlZAEgzIk3FBq23ZABiOGbAZDZD";
      window.FB.api("/1389776634498901/feed", response  =>  {
          console.log(response["data"][0].id)
          console.log("testss")
          if (response && !response.error) {
            this.setState({
              feeds: response["data"][0].id
            });
          }
        }, {access_token: token}
      );
    };
  }

  render(){
    return (
      <div className="container">
        <div className="fb-header-base">
        </div>
        <div className="fb-header">
          <div id="img1" className="fb-header"><img src="facebook1.png" className = "logo"/></div>
        </div>
        <div className="center">
        <ShowList items={this.state.feeds}/>
        data : {this.state.feeds}
      </div> 
      </div> 
    );
  }
}


export default App;
